INSERT INTO `fiden_social` VALUES ('M18030231', '3', 'Porque todos nos llevamos bien', '3', 'Porque son buenas personas', '0', '0', '', '3', 'Porque enseñan bien', '2', 'Porque existe necesidad de ir a sus apartamentos', 'Diseñar, jugar o leer', 'Armar prototipos', 'Terminar la carreta universitaria', 'Ayudar a la humanidad con avances tecnológicos', 'Un humano con sueños', 'Tranquilo, responsable, y respetuoso', 'Las personas sean comprensibles', 'A ser una buena persona', 'Algo se interponga en mi camino');
INSERT INTO `fiden_social` VALUES ('M18030235', '2', 'Tratamos de llevarnos bien todos', '1', 'Tenemos comunicación', '0', '0', '', '2', 'Cumplo con la parte de aprendizaje', '2', 'Porque no los conozco a fondo', 'Leer', 'Bailar', 'Aprender ingles', 'Tener una carrera, un trabajo estable, viajar  ser independiente', 'Una persona a la cual le gusta aprender pero no de una forma rapida, me gusta tomar las cosas con calma y llevar todo a su tiempo', 'Fuerte', 'Me tomen encuenta en algunas actividades', 'Ser una mejor persona', 'No pueda cumplir algunas de las metas ya mencionadas');
INSERT INTO `fiden_social` VALUES ('M18030236', '1', 'Porque con nadie me involucro para mal y los respeto', '3', 'Porque llevo tiempo de conocerlos', '0', '0', '', '1', 'Porque cumplo con lo que me toca', '2', 'Casi no interactuo con ellos', 'Tarea, leo un poco y escucho música.', 'Practicar deporte', 'No fallar con mis materias', 'Formar parte de una compañía de trabajo en el área de autorización', 'Una persona con grandes aspiraciones y sueños por cumplir.', 'Tranquilo', 'Las cosas salgan me queden perfectas y que se acaten las reglas.', 'Viajar por parte de la empresa a la cual pertenezco.', 'Me muera antes de tiempo y no cumpla con mis sueños\\r\\nO que las cosas no marchen del todo bien.');
INSERT INTO `fiden_social` VALUES ('M18030238', '3', 'Porque pensamos casi lo mismo, tenemos las mismas metas y compromisos.', '3', 'Porque tenemos algo similar que pensar y también por la confianza que hemos tenido desde pequeños.', '1', '3', 'Excelente, nos entendemos en cuanto a darnos tiempo para terminar nuestras cartearas profesionales.', '3', 'Porque ellos se adentran a lo que es su trabajo.', '3', 'Porque te ayudan cuando tienes problemas o necesitas algo.', 'Ejercicio.', 'Trabajar.', 'Invertir en un pequeño negocio para generar ingresos para un sustento en un futuro.', 'Titularme como Ingeniero Mecatronico, trabajar en alguna empresa de diseño o enseñar lo que se como maestro.', 'Una persona tranquila y amigable.', 'Es a cómo las personas me traten, creo así atenderemos más rápido nuestras indiferencias.', 'Que me traten como lo que soy.', 'A siempre ser una persona amigable que no tenga problemas tontos con nadie.', 'A qué algo me salga mal en algún plan tan esperado.');
